var long_run = [];

var trainingQuerySymbol = undefined;

// a pure-ish version of searchForMatchingSymbols that doesn't
// display anything and takes a symbol as input.
function query(currentSymbol) {
    var scored = [];
    for (index = 0; index < storedSymbols.length; ++index) {
        scored.push([storedSymbols[index],
                     Math.exp(score(storedSymbols[index],currentSymbol))
                     ]);
    }
    // the Math.exp makes this a log-linear maxent model
    // now sort the best (highest scoring) stored symbols to the front of the list
    scored.sort(function (a,b) { return (b[1] - a[1]); });
    var nBest = scored.slice(0,NMATCHES);
    displayedOptionSymbols = nBest; // the perceptron uses this global var
    trainingQuerySymbol = currentSymbol;
}

// a pure-ish version of of the click handler in makeMiniCanvas that doesn't
// display anything and takes a word as input.
function select(word) {
    trainLanguageModel(word);
    for (var index = 0; index < displayedOptionSymbols.length; ++index) {
        if (displayedOptionSymbols[index].word == word) {
            adjustFeatures(displayedOptionSymbols[index],
                           trainingQuerySymbol,
                           1);
        } else {
            adjustFeatures(displayedOptionSymbols[index],
                           trainingQuerySymbol,
                           0);
        }
    } // end for each displayed symbol
}

// pure-ish version of the record-button
function load(symbol) {
    storedSymbols.push(symbol,symbol.word);
}

function trainOn(data,n) {
    for (var reps=0; reps<n; reps++) {
        for (var i=0; i<data.length; i++) {
            var thisRun = data[i];
            clear_vocab();
            for (var j=0; j<thisRun.length; j++) {
                var symbol = thisRun[j];
                if (symbol.mode == "create") {
                    load(symbol);
                } else { // mode == "reproduce"
                    query(symbol);
                    select(symbol.word);
                }
            }
        }
    storedSymbols = [];
    console.log((reps+1)+"/"+n);
    }
}

